commit_message:
build.py: automatically strip class "suffixes", then reinsert after By class "suffix", I mean any portion of a class which is after it's
auto-generated code.  Most of the time, these are after the auto-
generation because they rely on auto-generated members, which means they
would not be usable when building... thus the auto stripping.  They
get inserted back after the auto-generation happens.  This way, instead
of always having to guard suffix code like this:

class MyClass():
# ------ Do not edit below this line --------
    def apiWidth(self):
        return blahBlah()
# ------ Do not edit above this line --------
    if _f.building:
        width = property(apiWidth)

you can just do:

class MyClass():
# ------ Do not edit below this line --------
    def apiWidth(self):
        return blahBlah()
# ------ Do not edit above this line --------
    width = property(apiWidth)
